Solve the following first-order differential equation:
\\begin{equation*}
    \\frac{dy}{dx} + 2y = e^{-x}, \\quad y(0) = 1.
\\end{equation*}

results.generated_solution:
The given differential equation is a first-order linear differential equation of the form:
\\begin{equation*}
    \frac{dy}{dx} + P(x)y = Q(x),
\\end{equation*}
where $P(x) = 2$ and $Q(x) = e^{-x}$.

To solve this equation, we will use the integrating factor method. The integrating factor is given by:
\\begin{equation*}
    \mu(x) = e^{\int P(x) \, dx} = e^{\int 2 \, dx} = e^{2x}.
\\end{equation*}

Multiplying both sides of the differential equation by the integrating factor, we get:
\\begin{equation*}
    e^{2x} \frac{dy}{dx} + 2e^{2x} y = e^{2x} e^{-x} = e^x.
\\end{equation*}

The left-hand side of this equation can be written as the derivative of the product of $y$ and the integrating factor:
\\begin{equation*}
    \frac{d}{dx} (e^{2x} y) = e^x.
\\end{equation*}

Integrating both sides of this equation with respect to $x$, we get:
\\begin{equation*}
    e^{2x} y = \int e^x \, dx = e^x + C,
\\end{equation*}
where $C$ is the constant of integration.

Dividing both sides of this equation by the integrating factor, we get:
\\begin{equation*}
    y = \frac{e^x + C}{e^{2x}} = e^{-x} + C e^{-2x}.
\\end{equation*}

To find the value of $C$, we use the initial condition $y(0) = 1$:
\\begin{equation*}
    1 = e^{-0} + C e^{-2 \cdot 0}} = 1 + C.
\\end{equation*}

Solving for $C$, we get $C = 0$. Therefore, the solution to the differential equation is:
\\begin{equation*}
    y = e^{-x}.
\\end{equation*}

